import About from "./components/welcoming/about";

const Welcoming = () => {
  return (
   <>
   <Nav />
  <section>
  <Header />
  </section>
  <section>
  <Services />
  </section>
  <section>
  <Achievements />
  </section>
  <section>
  <About />
  </section>
   </>
  );
}

export default Welcoming;
